import { createRoutes, Link } from 'react-router-dom';
import "./App.css";
import Navbar from "./components/Navbar";
import Footer from "./components/Footer";
import Home from "./pages/Home";
import Destinations from "./pages/Destinations";
import About from "./pages/About";
import Login from "./pages/Login";
import Skardu from "./pages/Skardu";
import Swat from "./pages/Swat";
import Gilgit from "./pages/Gilgit";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/menu" element={<Destinations />} />
          <Route path="/about" element={<About />} />
          <Route path="/login" element={<Login />} />
          <Route path='/destinations/swat' element={<Swat />} />
          <Route path='/destinations/skardu' element={<Skardu />} />
          <Route path='/destinations/gilgit' element={<Gilgit />} />
        </Routes>
        <Footer />
      </Router>
    </div>
  );
}

export default App;
